var tipuesearch = {"pages": [{'title': 'About', 'text': '\n \n  取 Dart 程式的按鈕  \n 純 Dart 程式 \n Hello   For Loop   Sum   Runge-Kutta   RK ex1   Mass Spring Damping \n Html 程式 \n ROC Flag   Grid   Slithery \n Flutter 程式 \n Flutter1   Flutter2   Flutter3 \n  內建放入的 Dart 原始碼  \n 放大   回復 \n \n 個人倉儲: https://github.com/s40523113/cp2019 \n dartpad網站: https://dartpad.dev/', 'tags': '', 'url': 'About.html'}, {'title': '每週進度', 'text': '', 'tags': '', 'url': '每週進度.html'}, {'title': 'w3', 'text': '\n hello原始碼: \n void main() {\n    print("hello");\n} \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w4', 'text': '將圖片嵌入置網頁 \n \n \n', 'tags': '', 'url': 'w4.html'}, {'title': 'w6', 'text': '\n for迴圈原始碼 \n // 在所有函式定義外圍所宣告的變數, 稱為全域變數, 有效範圍包含各函式內部與外部\n// for 迴圈所使用的索引值, 宣告為整數 (integer)\nint i;\n// 累加起始值 start 宣告為整數, 且設為 1\nint start = 1;\n// 累加終止值 end 宣告為整數, 且設為 10\nint end = 10;\n// 累加總數值 sum 宣告為整數\nint sum;\n\n// 定義 main() 主函式內容, 目的在利用 for 迴圈進行整數的累加\nmain(){\n  // 將前面已經宣告為全域整數的變數 sum 設為 0, 表示從 0 開始進行累加\n  sum = 0;\n  // 執行 for 迴圈內的整數累加設計, 使用前面已經宣告為全域整數的 i 作為索引變數\n  // 分別從 start 開始累加至 end, 且每次迴圈的索引值增加 1\n  for(i=start;i <= end ;i++){\n    // 當索引變數 i 所對應的值小於或等於 end 時, 對 sum 變數加上 i\n    sum += i;\n    // 可以在 for 迴圈每一個階段運算時, 列出當時的 sum 對應值, 查驗是否正確\n    //print("$sum");\n  }\n  // for 迴圈累加完成後, 列出最後訊息\n  print(\'從 $start 累加至 $end 的總數值為 $sum\');\n} \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w8', 'text': '建立個人網誌 期中報告影片 \n', 'tags': '', 'url': 'w8.html'}, {'title': 'w11', 'text': '', 'tags': '', 'url': 'w11.html'}]};